import axios from "axios";
import "./login.css";

export default function Login(){
    return <div className="login">
        <div className="form">
            
            <span>
                <input type="text"/>
                <input type="password"/>
            </span>

            <button className="btn"><strong>LOGIN</strong></button>
        </div>
    </div>
}
